import { useEffect, useState } from "react";
import "./App.css";
import "./main.css";
import axios from "axios";

function App() {
  const [item, setItem] = useState([]);
  useEffect(() => {
    const fecthItem = async () => {
      const results = await axios("https://jsonplaceholder.typicode.com/users");
      setItem(results.data);
    };

    fecthItem();
  }, []);
  return (
    <>
      <div className="robot-grid">
        <div className="robot-img">
          {item.map((item) => (
            <li key={item.id}>
              <p>{item.name}</p>
            </li>
          ))}
        </div>
      </div>
    </>
  );
}

export function AfficheRobot() {
  const [image, setImage] = useState([]);
  useEffect(() => {
    const gettingImage = async () => {
      const getImage = await axios(
        "https://jsonplaceholder.typicode.com/users"
      );
      setImage(getImage.data);
    };
    gettingImage();
  });
  return (
    <>
      <p>Hello!</p>
      <div>{image.id}</div>
    </>
  );
}
export function Title() {
  return <h1>MES AMIS ROBOT</h1>;
}
export function Input() {
  return <input placeholder="rechercher par nom " />;
}

export default App;
